import { Link } from "react-router-dom";
import  Img  from "../assets/img/play.png";

const TvCard = ({ id, title, imgLink, rating, relaseDate }) => {
  return (
    <Link to={`/tv/${id}`} className="card">
      <div className="card__img">
        <img src={imgLink} alt="Card Img" />
      </div>
      <div className="card__content">
        <h2>{title}</h2>
        <span className="relase-date">{relaseDate}</span>
        <span className="rating">{rating}</span>
        <img className="Playimg" src={Img} alt="img" />
      </div>
    </Link>
  );
};

export default TvCard;
